  let audioElement;

  function reproducirAudio() {
    if (!audioElement) {
      audioElement = new Audio(audioBase64.trim());
      audioElement.loop = true;
    }
    audioElement.play().catch(() => {
      console.log("Haz clic para iniciar el audio.");
    });
  }

  function crearImagen(src) {
    const img = document.createElement("img");
    img.src = src;
    img.className = "soggy-img";
    const size = 100 + Math.random() * 200;
    img.style.width = size + "px";
    img.style.left = Math.random() * window.innerWidth + "px";
    img.style.top = Math.random() * window.innerHeight + "px";
    img.style.animationDuration = (1 + Math.random() * 3) + "s";
    document.body.appendChild(img);

    // Movimiento loco con rebote
    setInterval(() => {
      img.style.left = Math.random() * window.innerWidth + "px";
      img.style.top = Math.random() * window.innerHeight + "px";
    }, 1000 + Math.random() * 2000);
  }

  function crearTexto() {
    const div = document.createElement("div");
    div.className = "texto-loco";
    div.innerText = frases[Math.floor(Math.random() * frases.length)];
    div.style.left = Math.random() * window.innerWidth + "px";
    div.style.top = Math.random() * window.innerHeight + "px";
    div.style.fontSize = (2 + Math.random() * 4) + "em";
    div.style.animationDuration = (1 + Math.random() * 2) + "s";
    document.body.appendChild(div);

    // Cambiar ubicaci√≥n y texto aleatoriamente
    setInterval(() => {
      div.style.left = Math.random() * window.innerWidth + "px";
      div.style.top = Math.random() * window.innerHeight + "px";
      div.innerText = frases[Math.floor(Math.random() * frases.length)];
    }, 1000 + Math.random() * 3000);
  }

  function explotar() {
    // Crea explosi√≥n de im√°genes y textos al hacer clic
    for (let i = 0; i < 10; i++) {
      crearImagen(assets[Math.floor(Math.random() * assets.length)]);
    }
    for (let i = 0; i < 5; i++) {
      crearTexto();
    }
  }

  function iniciarLocura() {
    for (let i = 0; i < 25; i++) {
      crearImagen(assets[Math.floor(Math.random() * assets.length)]);
    }
    for (let i = 0; i < 15; i++) {
      crearTexto();
    }
    reproducirAudio();
  }

  window.onload = () => {
    iniciarLocura();
  };

  window.addEventListener("click", () => {
    reproducirAudio();
    explotar();
